export type IconKeys = keyof typeof ICONS;

interface CustomIconProps extends IconProps {
  name: IconKeys;
}

export const CustomIcon = ({
  color = "pebble.600",
  boxSize = "16px",
  name,
  ...iconProps
}: CustomIconProps) => (
  <Icon
    viewBox={ICONS[name].viewBox}
    color={color}
    margin={1}
    boxSize={boxSize}
    {...iconProps}
  >
    {ICONS[name].svg}
  </Icon>
);
